import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './PastResultsPage.css';

const PastResultsPage = () => {
  const [pastResults, setPastResults] = useState([]);

  useEffect(() => {
    // Fetch past results from the backend
    const fetchPastResults = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:5000/api/past-results');
        setPastResults(response.data);
      } catch (error) {
        console.error('Error fetching past results:', error);
      }
    };

    fetchPastResults();
  }, []);

  return (
    <div className="past-results-page">
      <header>
        {/* Your header content */}
      </header>
      <main>
        <h2>Past Results</h2>
        <div className="results-grid">
          {pastResults.map((result, index) => (
            <div key={index} className="result-item">
              <img src={`user_uploads/${result.file_name}`} alt="Completed scan" />
              <p className="scan-time">Scan Time: {result.created_at}</p>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default PastResultsPage;
